import React, { useState, MouseEvent } from "react";
import { Link } from "react-router-dom";
import { MDCTopAppBar } from "@material/top-app-bar";
import "../styles/navigation.scss";

function Navigation() {
  const [anchorEl, setAnchorEl] = useState<null | HTMLElement>(null);

  const handleClick = (e: MouseEvent<HTMLButtonElement>) => {
    setAnchorEl(e.currentTarget);
  };

  const handleClose = () => {
    setAnchorEl(null);
  };

  MDCTopAppBar.attachTo(document.querySelector('.mdc-top-app-bar') as HTMLElement );
  const preventDefault = (event: React.SyntheticEvent) =>
    event.preventDefault();
  return (
    <>
      <header className="mdc-top-app-bar mdc-top-app-bar--dense">
        <div className="mdc-top-app-bar__row">
          <section className="mdc-top-app-bar__section mdc-top-app-bar__section--align-start">
            <button className="mdc-icon-button material-icons mdc-top-app-bar__navigation-icon--unbounded">
              menu
            </button>
            <span className="mdc-top-app-bar__title">San Francisco, CA</span>{" "}
          </section>
          <section className="mdc-top-app-bar__section mdc-top-app-bar__section--align-end">
            <button
              className="mdc-icon-button material-icons mdc-top-app-bar__action-item--unbounded"
              aria-label="Download"
            >
              file_download
            </button>
            <button
              className="mdc-icon-button material-icons mdc-top-app-bar__action-item--unbounded"
              aria-label="Print this page"
            >
              print
            </button>
            <button
              className="mdc-icon-button material-icons mdc-top-app-bar__action-item--unbounded"
              aria-label="Bookmark this page"
            >
              bookmark
            </button>
          </section>
        </div>
      </header>

      <button
        aria-controls="simple-menu"
        aria-haspopup="true"
        onClick={handleClick}
      >
        button
      </button>
      <Link to="/missionboard">Mission Board</Link>
    </>
  );
}

export default Navigation;
